import React, { Component } from 'react';
import MuiThemeProvider from 'material-ui/styles/MuiThemeProvider';
import {Grid,Row,Col} from 'react-flexbox-grid';
import AppBar from 'material-ui/AppBar';
import './App.css';
import Paper from 'material-ui/Paper';
import LocationList from './components/LocationList'
import ForecastExtended from './components/ForecastExtend';
const cities=['Buenos Aires,ar','Ciudad de México,mx','Madrid,es'];


class App extends Component {
  handleSelectionLocation=city=>
  {
    //console.log(`handleSelectionLocation ${city }`); 
  } 
  render() {
    return (
      <MuiThemeProvider>
        <Grid>
          <Row>
            <Col xs={12}>
              <AppBar title="Weather App"></AppBar>

            </Col>
          </Row>
          <Row>
            <Col xs={12} md={6}>
              <LocationList cities={cities}
              onSelectedLocation={this.handleSelectionLocation}></LocationList>
            </Col>
            <Col xs={12} md={6}>
              <Paper zDepth={4}>
                <div className='detail'>
                  <ForecastExtended city={'LLego'}></ForecastExtended>
                </div>
              </Paper>
            </Col>
          </Row>

        </Grid>
      </MuiThemeProvider>
    );
  }
}

export default App;
